async function extractJSONArray(text) {
    const startIndex = text.indexOf('{');
    if (startIndex === -1) {
        throw new Error("No {} found in text");
    }

    let bracketCount = 0;
    let endIndex = -1;

    for (let i = startIndex; i < text.length; i++) {
        if (text[i] === '{') bracketCount++;
        else if (text[i] === '}') bracketCount--;

        if (bracketCount === 0) {
            endIndex = i;
            break;
        }
    }

    if (endIndex === -1) {
        throw new Error("JSON array is not closed properly.");
    }

    const jsonArrayText = text.slice(startIndex, endIndex + 1);
    console.log("Extracted JSON Array Text:", JSON.parse(jsonArrayText));
    return JSON.parse(jsonArrayText);
}

async function predictSubTopic(inputText) {

    // input text contains some html & css tags like this - <p><strong>Problem Statement: Employee Management System</strong></p><p><strong>Objective:</strong></p><p><span style=\"color: rgb(51, 51, 51);\">You need to create the </span>
    // We need to remove these tags and only keep the text content
    inputText = inputText.replace(/<[^>]*>/g, ' ').replace(/\s+/g, ' ').trim();


    try {
        const prompt = `Based on the following question, predict the most relevant and specific subject, topic, and subtopic names.
These names reflect the real-world context of the question with the programming language it belongs to (ie) if it is related to dotnet, then return as ASP.net.
note: Don't return generic names like "Programming" or "Web Development" & don't return any scenarios or examples.
Return the result in JSON format: {"subject": "...", "topic": "...", "sub_topic": "..."}

Question: ${inputText.trim().slice(0, 2000)}`;
    
    // reduce the input text to a maximum of 1000 characters

    console.log("Prompt for prediction:", prompt);
    

        const response = await grop.chat.completions.create({
            model: 'llama3-8b-8192',
            messages: [
                {
                    role: "system",
                    content: `You are an AI model that analyzes a question and predicts the most suitable subject, topic, and subtopic.
You must return detailed yet relevant categories. Do not be too generic (e.g., just "Programming") or too vague. You may include elaboration like "C# Programming for Web APIs" or "Routing in MVC Framework".`,
                },
                {
                    role: "system",
                    content: `Here are a few example categories for reference:\n` +
                        metadata.slice(0, 10).map(item =>
                            `Subject: ${item.topic.subject.name}, Topic: ${item.topic.name}, Subtopic: ${item.name}`
                        ).join('\n')
                },
                {
                    role: "user",
                    content: prompt,
                },
            ]
        });

        const resultText = response.choices[0].message.content;
        return resultText;

    } catch (error) {
        console.error("Error in predictSubTopic:", error);
    }
}


